import { Box } from "@mui/material";
import InsertDriveFileIcon from "@mui/icons-material/InsertDriveFile";
import React from "react";

export default function FileMessage({ bg, rounded }) {
  return (
    <Box className={`${bg} ${rounded} p-3`}>
      <Box sx={{ p: 1 }}>
        <InsertDriveFileIcon sx={{width: '25px', height: "50px"}} />
      </Box>
    </Box>
  );
}
